css:
atom-text-editor,
:host {
  background-color: #ffffff;
  color: #535353;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background-color: #f5f5f5;
}
atom-text-editor .cursor,
:host .cursor {
  border-left: 2px solid #446fbd;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #c6d6f5;
}
atom-text-editor .bracket-matcher .region,
:host .bracket-matcher .region {
  border-bottom: 1px solid #446fbd;
  box-sizing: border-box;
}
atom-text-editor .invisible,
:host .invisible,
atom-text-editor .invisible-character,
:host .invisible-character,
atom-text-editor .indent-guide,
:host .indent-guide,
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #d2d2d2;
}
atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  color: #535353;
}
atom-text-editor .gutter .line-number.git-line-removed:before,
:host .gutter .line-number.git-line-removed:before {
  bottom: -3px;
}
atom-text-editor .gutter .line-number.git-line-removed:after,
:host .gutter .line-number.git-line-removed:after {
  content: "";
  position: absolute;
  left: 0px;
  bottom: 0px;
  width: 25px;
  border-bottom: 1px dotted #eb4343;
  pointer-events: none;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  color: #535353;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #666666;
}
.basic {
  color: #535353;
}
.comment {
  color: #8c8c8c;
}
.string {
  color: #e67e22;
}
.constant {
  color: #c35dc3;
}
.boolean {
  font-weight: bold;
}
.boolean.true {
  color: #738d00;
}
.boolean.false {
  color: #eb4343;
}
.variable,
.support.class.php {
  color: #738d00;
}
.keyword,
.support.function.construct.php {
  color: #446fbd;
}
.storage {
  color: #666666;
}
.storage.type,
.meta.function-call.php {
  color: #8757ad;
}
.entity.name.class {
  color: #738d00;
}
.entity.other.inherited-class {
  color: #738d00;
}
.entity.name.function {
  color: #738d00;
}
.variable.parameter,
.keyword.operator.class.php {
  color: #e67e22;
}
.entity.name.tag,
.punctuation.definition.tag,
.meta.tag.sgml.html {
  color: #446fbd;
}
.entity.other.attribute-name {
  color: #738d00;
}
.support.function {
  color: #8757ad;
}
.support.constant {
  color: #8757ad;
}
.support.type,
.support.class {
  color: #e67e22;
}
.support.other.variable {
  color: #535353;
}
.invalid {
  color: #ffffff;
  background-color: #eb4343;
}
.markup.deleted {
  color: #d33682;
}
.markup.inserted {
  color: #738d00;
}
.markup.heading {
  font-weight: bold;
  color: #d33682;
}
.markup.italic {
  font-style: italic;
}
.markup.bold {
  font-weight: bold;
}
.markup.underline {
  text-decoration: underline;
}
.markup.quote,
.punctuation.definition.blockquote {
  font-style: italic;
  color: #666666;
}
.markup.list {
  color: #666666;
}
.markup.raw,
.markup.raw.block.markdown {
  color: #8ea812;
}
.entity.name.tag.doctype.html {
  color: #414141;
}
.media.css,
.media.css > .keyword {
  color: #446fbd;
  font-weight: bold;
}
.variable.less {
  background-color: rgba(142, 168, 18, 0.1);
  font-style: italic;
}
.markup.heading-1,
.markup.heading-1 > .marker {
  color: #f92672;
}
.markup.heading-2,
.markup.heading-2 > .marker {
  color: #d33682;
}
.markup.heading-3,
.markup.heading-3 > .marker {
  color: #446fbd;
}
.markup.heading-4,
.markup.heading-4 > .marker {
  color: #446fbd;
  font-weight: normal;
}
.markup.heading-5,
.markup.heading-5 > .marker {
  color: #666666;
}
.markup.heading-6,
.markup.heading-6 > .marker {
  color: #666666;
  font-weight: normal;
}
.link > .punctuation {
  color: #8c8c8c;
}
